package main

import (
	"encoding/hex"
	"encoding/json"
	"fmt"
	"os"

	"github.com/dgraph-io/badger/v2"
	badgerOpts "github.com/dgraph-io/badger/v2/options"
)

func main() {
	fmt.Println("=======start=======")
	osArgs := os.Args
	path := osArgs[1]

	fmt.Println(path)
	//dir := filepath.Join("/Users/sidney/Documents/qlink/node2/config/data5/ledger")
	opts := badger.DefaultOptions(path)

	opts.ValueLogLoadingMode = badgerOpts.FileIO
	db, err := badger.Open(opts)
	if err != nil {
		fmt.Println("open badger: ", err)
		return
	}
	defer db.Close()

	txn := db.NewTransaction(true)
	defer txn.Commit()

	infos := getInfos()
	for k, v := range infos {
		kbytes, err := hex.DecodeString(k)
		if err != nil {
			fmt.Println(err)
		}
		vbytes, err := hex.DecodeString(v)
		if err != nil {
			fmt.Println(err)
		}
		err = txn.Set(kbytes, vbytes)
		if err != nil {
			fmt.Println(err)
		}
	}
	fmt.Println("=======done=======")
}

func getInfos() map[string]string {
	data, err := hex.DecodeString(infoStr)
	if err != nil {
		fmt.Println(err)
	}
	infos := make(map[string]string)
	if err := json.Unmarshal(data, &infos); err != nil {
		fmt.Println(err)
	}
	return infos
}

var infoStr = ""
